using System;
using System.ComponentModel.DataAnnotations;
using System.ComponentModel.DataAnnotations.Schema;
using System.IO;

using Xamarin.Forms;

namespace CoralClient.Model
{
    public class ServerProfile
    {
        [Key]
        public Guid Id { get; set; }

        public string Uri { get; set; }

        public ushort MinecraftPort { get; set; } = 25565;

        public ushort RconPort { get; set; }

        public string Password { get; set; }

        public string ImageB64 { get; set; }

        [NotMapped]
        public ImageSource Image
        {
            get
            {
                const string defaultServerIcon =
                    "";

                var b64 = ImageB64;

                if (string.IsNullOrEmpty(b64))
                {
                    b64 = defaultServerIcon;
                }

                try
                {
                    var imageBytes = Convert.FromBase64String(b64);

                    return ImageSource.FromStream(() => new MemoryStream(imageBytes));
                }
                catch (Exception e)
                {
                    return null;
                }
            }
        }


        [NotMapped]
        public string ServerUriText => $"{Uri}:{MinecraftPort}";
    }
}